import java.util.LinkedList;
import java.util.PriorityQueue;
import java.util.Queue;

public class M_Jump_Game_7_1871 {

    public static void main(String[] args) {
        String string = "";
        System.out.println(new M_Jump_Game_7_1871().canReach(string, 1, 49999));

        System.out.println(new M_Jump_Game_7_1871().canReach("00111010", 3, 5));

        System.out.println(new M_Jump_Game_7_1871().canReach("0000000000", 2, 5));

        System.out.println(new M_Jump_Game_7_1871().canReach("011010", 2, 3));

        System.out.println(new M_Jump_Game_7_1871().canReach("01101110", 2, 3));
    }

    public boolean canReach2(String s, int minJump, int maxJump) {
        char[] chars = s.toCharArray();
        if (chars[chars.length - 1] == '1') {
            return false;
        }

        boolean[] visited = new boolean[chars.length];
        return rec(chars, 0, minJump, maxJump, visited, new int[]{0});
    }

    private boolean rec(char[] chars, int index, int minJump, int maxJump,
                        boolean[] visited, int[] farthest) {
        if (index == chars.length - 1) return true;

        visited[index] = true;

        int start = Math.max(index + minJump, farthest[0] + 1);
        int end = Math.min(index + maxJump, chars.length - 1);

        for (int i = start; i <= end; i++) {
            if (chars[i] == '0' && !visited[i]) {
                if (rec(chars, i, minJump, maxJump, visited, farthest)) {
                    return true;
                }
            }
        }

        farthest[0] = Math.max(farthest[0], end);

        return false;
    }

    public boolean canReach(String s, int minJump, int maxJump) {
        int n = s.length();
        if (s.charAt(n - 1) == '1') return false;

        boolean[] visited = new boolean[n];
        Queue<Integer> q = new LinkedList<>();
        q.offer(0);
        visited[0] = true;

        int farthest = 0;
        while (!q.isEmpty()) {
            int idx = q.poll();

            int start = Math.max(idx + minJump, farthest + 1);
            int end = Math.min(idx + maxJump, n - 1);

            for (int i = start; i <= end; i++) {
                if (s.charAt(i) == '0' && !visited[i]) {
                    if (i == n - 1) return true;
                    visited[i] = true;
                    q.offer(i);
                }
            }
            farthest = end;
        }
        return false;
    }
}
